import React, { Component } from 'react';
class HOME extends Component {

    state ={
        count: 0
    }

    render() { 
    return (
    <div>
        
        <h1 className>{this.formatCount()}</h1>
        <p>{5+8}</p>
    </div>);
    }

    formatCount(){
        const {count} = this.state;
        return count === 0 ? <h1>Zero</h1> : count;
    }
    }
 
export default HOME;
